import axios from 'axios';
import getDeviceData from "./getDeviceData";
import getUserData from "./getUserData";
import getLineData from "./getLineData";
import getVoicemailData from "./getVoicemailData"

export default async function callApi() {
  let rawData = {}
  let cleanData = {}
  let locationHierarchy = {}

  let res = await axios.get(`http://localhost:5000/devices`)
    try {
      console.log(res.status)
      rawData['devices'] = res['data']
      cleanData['devices'] = await getDeviceData(res)
    }
    catch {console.log(res.status)}

  res = await axios.get(`http://localhost:5000/users`)
  try {
    console.log(res.status)
    rawData['users'] = res['data']
    cleanData['users'] = await getUserData(res)
  }
  catch {console.log(res.status)}

  res = await axios.get(`http://localhost:5000/lines`)
  try {
    console.log(res.status)
    rawData['lines'] = res['data']
    cleanData['lines'] = await getLineData(res)
  }
  catch {console.log(res.status)}

  res = await axios.get(`http://localhost:5000/voicemails`)
  try {
    console.log(res.status)
    rawData['voicemails'] = res['data']
    cleanData['voicemails'] = await getLineData(res)
  }
  catch {console.log(res.status)}

  res = await axios.get(`http://localhost:5000/location_hierarchy`)
  try {
    console.log(res.status)
    locationHierarchy = res['data']
  }
  catch {console.log(res.status)}

  return new Promise((resolve, reject) => {
    resolve({
      "rawData": rawData,
      "cleanData": cleanData, 
      "locationHierarchy": locationHierarchy
    })
    reject("fail")
  })
}
